import { ColumnNumber, FirstColumn, DataColumn, CommentColumn, Thead } from "./Table.style";
import { Icon, IconAbsolute } from "./IconComponent/Icon";
import { RowType } from "./Table";
import { FC } from "react";
import { TableStatus } from "../constants/TableType";
import { COLORS } from "../constants/colors";
import styled from "@emotion/styled";
const statusColors: Record<TableStatus, string> = {
  [TableStatus.CANCELED]: COLORS.ORANGE,
  [TableStatus.AFFIRM]: COLORS.BLACK,
  [TableStatus.PROCESSING]: COLORS.BLUE,
  [TableStatus.DONE]: COLORS.POLARGREEN,
};
export const TableBody: FC<RowType> = (row) => {
  const ColumnStatus = styled("div")`
    width: 240px;
    height: 56px;
    align-items: center;
    font-size: 14px;
    line-height: 22px;
    padding: 17px 16px;
    display: flex;
    font-weight: 500;
    position: relative;
  `;
  return (
    <tr>
      <td style={{ borderTopLeftRadius: "10px" }}>
        <FirstColumn></FirstColumn>
      </td>

      <td>
        <ColumnNumber style={{ justifyContent: "space-between" }}>
          {row.numberContract}
          <div style={{ display: "flex", flexDirection: "column" }}>
            <Icon type="IconUp" />
            <Icon type="IconDown" />
          </div>
          <IconAbsolute type="Divider" />
        </ColumnNumber>
      </td>

      <td>
        <DataColumn>
          {row.startDate} <IconAbsolute type="Divider" />
        </DataColumn>
      </td>
      <td>
        <DataColumn>
          {row.finalDate} <IconAbsolute type="Divider" />
        </DataColumn>
      </td>
      <td>
        <CommentColumn>
          fdf
          <IconAbsolute type="Divider" />
        </CommentColumn>
      </td>
      <td>
        <ColumnStatus color={statusColors["Отклонен"]}>
          {row.status}
          <IconAbsolute type="Divider" />
        </ColumnStatus>
      </td>
      <td style={{ borderTopRightRadius: "10px" }}>
        <ColumnNumber>
          <p>
            <a href={row.proceed}>proocced</a>
          </p>
          <br />
          <a href={row.download}>down</a>
        </ColumnNumber>
      </td>
    </tr>
  );
};
